import {Button} from 'reactstrap'
import 'bootstrap/dist/css/bootstrap.css';
import ModalExample from "./components/modal";
import ExampleNav from "./components/nav";
import Navbar from "reactstrap/es/Navbar";
import TableR from "./components/tableR";
import SoldierTable from "./components/soldierTable";
import paginationFactory from 'react-bootstrap-table2-paginator';
import Pagination from "reactstrap/es/Pagination";
import { TablePagination } from 'react-pagination-table';
import Table from "@material-ui/core/Table";

let users=[];
function buildFakeUser(i) {
    return {
        name:i,
        avatar:'2',
        email:'3',
        color:'4'
    };
}

for(var i = 0; i < 25; i++) {
    users.push(buildFakeUser(i))
}


function App() {
  return (
      <div>
        <ExampleNav/>
        {/*<SoldierTable/>*/}
        <Table></Table>
      </div>
  );
}

export default App;
